SET FOREIGN_KEY_CHECKS = 0;

DROP TABLE IF EXISTS  `question`;
CREATE TABLE `question` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `question` text NOT NULL,
  `a` text,
  `b` text,
  `c` text,
  `d` text,
  `randomtrue` char(1) DEFAULT NULL,
  `peoplelimit` int(11) NOT NULL,
  `addscore` int(11) NOT NULL,
  `minusscore` int(11) NOT NULL,
  `sort` int(11) NOT NULL,
  `extension` int(11) NOT NULL DEFAULT '0',
  `availabletime` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=81 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `question_buffer`;
CREATE TABLE `question_buffer` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `peopleid` int(11) NOT NULL,
  `questionid` int(11) NOT NULL,
  `time` datetime(6) NOT NULL,
  `done-time` datetime(6) NOT NULL DEFAULT '9999-12-31 00:00:00.000000' COMMENT '提交答案的时间',
  `state` text,
  `choose` text,
  `ts` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `questionid` (`questionid`),
  KEY `state` (`state`(7))
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

DROP TABLE IF EXISTS  `question_config`;
CREATE TABLE `question_config` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `keyname` varchar(20) NOT NULL,
  `value` text NOT NULL,
  PRIMARY KEY (`id`),
  KEY `keyname` (`keyname`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `question_idcinputtime`;
CREATE TABLE `question_idcinputtime` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `peopleid` int(11) NOT NULL,
  `questionid` int(11) NOT NULL,
  `idcinputtime` datetime NOT NULL,
  `delay` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `questionid` (`questionid`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `question_people`;
CREATE TABLE `question_people` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` text NOT NULL,
  `tel` text NOT NULL,
  `rightcount` int(11) NOT NULL DEFAULT '0',
  `wrongcount` int(11) NOT NULL DEFAULT '0',
  `score` int(11) NOT NULL DEFAULT '0',
  `historyscore` text NOT NULL,
  `rightids` text,
  `wrongids` text,
  `randomkey` text,
  `achievetime` datetime(6) NOT NULL,
  `achievets` int(11) DEFAULT NULL,
  `isbanned` int(11) NOT NULL DEFAULT '0',
  `wrongidccount` int(11) NOT NULL DEFAULT '0',
  `ranking` int(11) NOT NULL DEFAULT '0',
  `oldranking` int(11) NOT NULL DEFAULT '1000',
  `historyranking` text NOT NULL COMMENT '每一次的排名情况',
  `participateyears` text NOT NULL COMMENT '参与过的年份',
  `historydata` text NOT NULL COMMENT '记录之前每一年这个人的答题统计',
  `active` tinyint(4) NOT NULL DEFAULT '1' COMMENT '用来记录连续没有输入验证码的次数',
  `activeminusscore` mediumint(9) NOT NULL DEFAULT '0' COMMENT '因为没有输入验证码消极比赛而扣除的分数总和',
  `lastactiveyear` int(11) NOT NULL COMMENT '最后一次参与这个活动的年份',
  `reason-for-score` varchar(20) NOT NULL DEFAULT 'none' COMMENT '加扣分原因',
  PRIMARY KEY (`id`),
  KEY `active` (`active`),
  KEY `lastactiveyear` (`lastactiveyear`)
) ENGINE=InnoDB AUTO_INCREMENT=619 DEFAULT CHARSET=utf8;

DROP TABLE IF EXISTS  `question_player_history`;
CREATE TABLE `question_player_history` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `player-id` int(11) NOT NULL COMMENT '玩家id',
  `year` int(11) NOT NULL COMMENT '年份',
  `right-count` int(11) NOT NULL COMMENT '答对的题数',
  `wrong-count` int(11) NOT NULL COMMENT '答错的题数',
  `ranking` int(11) NOT NULL COMMENT '排名',
  `score` int(11) NOT NULL COMMENT '分数',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=452 DEFAULT CHARSET=utf8 COMMENT='历史数据';

SET FOREIGN_KEY_CHECKS = 1;

